QUnit.test("basics",function(d){var e=document.querySelector("#basics");var b=e.querySelectorAll("img");var c=d.async(3+b.length);var a=new imagesLoaded(e,function(f){d.ok(true,"callback function triggered");d.equal(a,f,"callback argument and instance match");c()});a.on("done",function(){d.ok(true,"done event triggered");c()});a.on("always",function(){d.ok(true,"always event triggered");c()});a.on("progress",function(f,g){d.ok(g.isLoaded,"image is loaded");c()})});